      nv.addGraph(function() {
        var chart = nv.models[opts.type]()
          .width(opts.width)
          .height(opts.height)
          
        if (opts.type != "bulletChart"){
          chart
            .x(function(d) { return d[opts.x] })
            .y(function(d) { return d[opts.y] })
        }
          
         
        chart
  .useInteractiveGuideline(false)
  .showLegend(true)
  .margin({
 "left":       40 
})
          
        chart.xAxis
  .tickFormat(
  function(d) {return d3.time.format('%Y-%m-%d')(new Date((d+1)*1000*3600*24));}
  )
  .rotateLabels(     -40)
  .axisLabel("Time ( (_oio_) )")
  .width(      40)

        
        
        chart.yAxis
  .axisLabel("Cumulative Relative Frequency of Google Search (Daily) %  Maryland State")
  .width(      40)
      
       d3.select("#" + opts.id)
        .append('svg')
        .datum(data)
        .transition().duration(500)
        .call(chart);

       nv.utils.windowResize(chart.update);
       return chart;
      });
    };
</script>
    
    <script></script>    
  </body>
